import React, { Component } from 'react'
import { 
  MDBRow,
  MDBCol,
  MDBBtn
} from "mdbreact";
import "../index.css";

export default class Contenedor extends Component {
  render() {
    return (
      <div>
        <MDBRow around>
          <MDBCol sm="8">Elige otra fecha de ida</MDBCol>
          <MDBBtn >Salir</MDBBtn>
        </MDBRow>
      </div>
    )
  }
}
